import React, { useEffect, useState } from 'react';
import styled from 'styled-components';

const StudyLogContainer = styled.div`
    background-color: #ccc;
    width: 1140px;
    height: 100%;
    padding: 20px;
`;

const StudyLogList = styled.ul`
    width: 100%;
    overflow: auto;
    height: 700px;
`;

const StudyLogHead = styled.li`
    color: #fff;
    background-color: #33a;
    padding: 4px 0;
    border-radius: 5px 5px 0 0;
    & ul {
        display: flex;
    }
    & > ul > li {
        text-align: center;
    }
`;

const LogNumber = styled.li`
    width: 60px;
`;

const LogId = styled.li`
    width: 60px;
`;

const LogMessage = styled.li`
    flex-grow: 1;
`;

const LogCreatedDate = styled.li`
    width: 100px;
`;

const LogType = styled.li`
    width: 80px;
`;

const LogCategory = styled.li`
    width: 100px;
`;

const LogMemberName = styled.li`
    width: 100px;
`;

const StudyLog = () => {
